import React from 'react';
import Cart from "./Cart";

function CartList({carts}) {

    const Carts = carts.Carts;
    const [cartCount, setCartCount] = useState(Carts);
    
    useEffect(()=> {
        setCartCount(carts.Carts)
    }, [carts.Carts])

    return (
    <div>
      <Cart/>
    </div>
  )
}

export default CartList
